insert into items (seller_id, name, description, available, active, price_per_hour, price_per_day, address, lat, lng, photo_url) values ('1', 'Intex Challenger Kayak', 'This kayak is made of durable welded material with eye-catching graphics for added safety on the lake or slow-moving river. It has a cargo net to store extra gear, and a grab line on both ends of kayak. I have used it for about six months, and it works great!', 'true', 'true', '10', '100', '2517 Enfield Rd, Austin, TX 78703', '30.289830', '-97.770838', 'http://res.cloudinary.com/drw6xrsdi/image/upload/v1439326970/camerazoom-20130515123251956-medium_tglmt8.jpg');
insert into items (seller_id, name, description, available, active, price_per_hour, price_per_day, address, lat, lng, photo_url) values ('1', 'Teton Sports Backpack', 'Has a compact internal frame and a capacity of 3,400 cubic inches or 55 liters. Fits a wide range of body sizes, and the padded straps make it super comfortable. Comes with a rain cover to protect your stuff.', 'true', 'true', '5', '50', '3406 Tom Green St Austin, TX 78705', '30.297659', '-97.732017', 'http://res.cloudinary.com/drw6xrsdi/image/upload/v1439327018/51I-kSUvgKL.jpgTETON-Sports-Fox-5200-Internal-Frame-Backpack-2-199x300_rn9f59.jpg');
insert into items (seller_id, name, description, available, active, price_per_hour, price_per_day, address, lat, lng, photo_url) values ('2', 'Sorrento Mountain Bike', 'This Diamondback bike is lighter than you might expect. I have taken it out on the Emma Long Motocross park a few times and it handles really well. I have some safety gear I can throw in if you need it.', 'true', 'true', '12', '75', '2310 E 9th St, Austin, TX 78702', '30.264131', '-97.716071', 'http://res.cloudinary.com/drw6xrsdi/image/upload/v1439327039/Diamondback_Outlook_2011_bxdkwj.jpg');
insert into items (seller_id, name, description, available, active, price_per_hour, price_per_day, address, lat, lng, photo_url) values ('2', 'Coleman Sundome Tent', 'A midsize tent that holds about six people and takes roughly 10 minutes to set up. It is waterproof, about 10 ft X 10 ft at the bottom and about 6 ft tall. Very nice tent for light camping.', 'true', 'true', '3', '25', '311 W Mary St, Austin, TX 78704', '30.246055', '-97.754530', 'http://res.cloudinary.com/drw6xrsdi/image/upload/v1439392637/71Vfnv7e-PL._SL1500__suksbi.jpg');
insert into items (seller_id, name, description, available, active, price_per_hour, price_per_day, address, lat, lng, photo_url) values ('3', 'Zebco Hawg Seeker Fishing Combo', 'The reel is equipped with the Bite Alert Technology, a powerful enhancement using the latest technology. This innovative feature makes it easy to see and hear fish bite at the end of your line, day or night.', 'true', 'true', '10', '80', '1802 Winter Park Rd, Austin, TX 78746', '30.262602', '-97.800408', 'http://res.cloudinary.com/drw6xrsdi/image/upload/v1439327090/HSBASP_oempeh.jpg');
insert into items (seller_id, name, description, available, active, price_per_hour, price_per_day, address, lat, lng, photo_url) values ('3', 'Aeropro Drive Tennis Racket', 'This racket has a USB charging port to recharge the battery contained in the handle which powers the diagnostic hardware. Really lightweight and strong.', 'true', 'true', '15', '100', '4700 Via Media, Austin, TX 78746', '30.315110', '-97.792279', 'http://res.cloudinary.com/drw6xrsdi/image/upload/v1439327115/babolat-aeropro-drive-cortex-racquets_vvya9w.jpg');
insert into items (seller_id, name, description, available, active, price_per_hour, price_per_day, address, lat, lng, photo_url) values ('4', 'River Run Inner Tube', 'A strong inner tube with an inflatable back support. Closed on the bottom. Two drink holders, handles, and an included life preserver and mini paddle make this perfect for tubing down the river.', 'true', 'true', '2', '20', '1700 Bowerton Dr, Austin, TX 78754', '30.376916', '-97.655578', 'http://res.cloudinary.com/drw6xrsdi/image/upload/v1439327151/71yRS1crVyL._SL1000__opbude.jpg');
insert into items (seller_id, name, description, available, active, price_per_hour, price_per_day, address, lat, lng, photo_url) values ('5', 'Coleman Camping Stove', 'This is a basic Coleman camping stove. I have had it for a year and it works great, just collecting dust now, so please use it! Comes with everything you need â€” mess kit, propane lighter. Cooks really fast for a small group. Happy camping!', 'true', 'true', '2', '25', '4008 Sinclair Ave, Austin, TX 78756', '30.311627', '-97.747486', 'http://res.cloudinary.com/drw6xrsdi/image/upload/v1439327167/coleman-300x225_ttjvki.jpg');
